import React, { Component } from 'react';
import { ImageBackground, StyleSheet, Text, TouchableOpacity, View } from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { TextInput } from 'react-native-gesture-handler';
import Checkbox from 'expo-checkbox';





export default class Login extends Component{


    constructor(props){
        super(props)
        this.state={
            email:'',
            password:''

        }
    }


    render(){
        return(
           <View style={{
            flexDirection:'column',
            flex:1,
           }}>
            <View style={{
                height:'20%',
                
                backgroundColor:'#50FAFA'
            }}><Text>Hello</Text></View>
            <View style={{
                
                width:'100%',
                height:'100%',
                backgroundColor:'#FA5075'
            }}><Text>HAMMAD</Text></View>
           </View>
        );

    }
}


const styles=StyleSheet.create({
    background: {
        position: 'absolute',
        left: 0,
        right: 0,
        top: 0,
        height: 350,
      },
      imageview:{
        width: 450,
        height:400,
        marginBottom:25,
        alignContent:'center',
        justifyContent:'center',
        alignItems:'center',
        alignSelf:'center'
      },
      inputViewA:{
        borderBottomWidth:2,
        borderBottomColor:'#FF595C',
        marginBottom:10,
        marginTop:30,
        alignSelf:'center',

  
        alignItems:'center',
        alignContent:'center',
        justifyContent:"space-evenly",
        backgroundColor: "#ffffff",
        borderRadius: 28,
        width: "80%",
        height: 55,
      },
      inputViewB:{
        borderBottomWidth:2,
        borderBottomColor:'#FF595C',
        marginTop:10,
        alignSelf:'center',
  
        alignItems:'center',
        alignContent:'center',
        justifyContent:"space-evenly",
        backgroundColor: "#ffffff",
        borderRadius: 28,
        width: "80%",
        height: 55,
      },
      TextInput:{
        alignContent:"center",
        justifyContent:"center",
        alignItems:"center",
        fontFamily:"monospace",
        width:"100%",
        paddingLeft:8,
        height:55
        
        
  
      },
      imageviewbackground:{
        height:1000,
        width:800,

      }

})
